CREATE TABLE gpxFiles
(
    id integer NOT NULL DEFAULT nextval('gpxcontent_id_seq'::regclass),
    filename character varying(500) COLLATE pg_catalog."default",    
    CONSTRAINT gpxFiles_pkey PRIMARY KEY (id)
)

