with subQ as (select distinct filename from gpxcontent)
insert into gpxfilescharacteristics (fileid, npoints, distance, timeoverall) select 
distinct gcc.filename,
(select ST_NPoints(r.Route) from (SELECT St_MakeLine(point) as Route, tab.filename
FROM (SELECT point, CAST(time As date) as Data_obs, filename
		FROM gpxcontent as gc where gc.filename=gcc.filename
			ORDER BY gc.time) tab group by tab.filename) as r) as npoints,
            
(select st_length(r.Route) from (SELECT St_MakeLine(point) as Route, tab.filename
FROM (SELECT point, CAST(time As date) as Data_obs, filename
		FROM gpxcontent as gc where gc.filename=gcc.filename
			ORDER BY gc.time) tab group by tab.filename) as r) as distance,
            
(select max(time)-min(time) from gpxcontent where filename= gcc.filename)  as timeOverall

from gpxcontent gcc , subQ q where 
gcc.filename=q.filename;
